import{buildNav}from"/js/DomComponents/nav.min.js";const main=document.getElementById("main");async function getTemplate(elem,file){const template=document.createElement("template"),data=await(await fetch(`/templates/${file}`)).text();let e;return template.innerHTML=data,template.content.querySelector(elem)}function insertElement(sibling,newNode,position){"after"===position?sibling.parentNode.insertBefore(newNode,sibling):sibling.parentNode.insertBefore(newNode,sibling.nextSibling)}async function getElements(){let nav=await getTemplate("nav","nav.html"),mobileNav=await getTemplate("nav","mobileNav.html"),footer=await getTemplate("footer","footer.html");insertElement(main,nav,"after"),insertElement(main,mobileNav,"before"),insertElement(main,footer,"before");let n=document.getElementById("nav");buildNav(n)}getElements();